		<ul class="article-list">
			<li class="clearfix">
				<a class="pic" href="http://go.taobao.com/note_view_3879.htm" target="_blank"><img src="http://img02.taobaocdn.com/tps/i2/T1w4IDXodbXXXEG.Zr-110-110.jpg" alt=""></a>
				<div class="extra">
					<h3><a href="http://go.taobao.com/note_view_3879.htm" target="_blank">梳子的香港澳门扫货攻略！</a></h3>
					<p>香港专业代购，梳子教你逛香港！不看你就奥特曼啦！ 吼吼~是哦~真的是梳子哦~ 相信大家对梳子也不陌生吧~ 如果有一直留意梳子的帖子的话，应该知道梳子以前是做跟单的吧 先来秀一下梳子以前在香港拍的照片吧~ 不过好久没有去了，哈哈 只好秀一下以前的照片吧~另外，梳子整理了一些问题，也请教了一下其他经常帮代购的同事 以问答的方式为大家解决一些香港败家游的问题哦！ 真的是体力活+技术活啊！ 如果觉得对你有帮助的话~给力顶顶贴吧各位美女~！ <a href="http://go.taobao.com/note_view_3879.htm" target="_blank">[查看全文]</a></p>
				</div>
			</li>
			<li class="clearfix">
				<a class="pic" href="http://go.taobao.com/note_view_18924.htm?type=2&fromId=1" target="_blank"><img src="http://img01.taobaocdn.com/tps/i1/T1vIkwXh8gXXXEG.Zr-110-110.jpg" alt=""></a>
				<div class="extra">
					<h3><a href="http://go.taobao.com/note_view_18924.htm?type=2&fromId=1" target="_blank">2012-11月-背上新的背包--旅行的意义</a></h3>
					<p>当生活被流行乐和快餐吞没的时候，旅行就是心灵的奢侈品了....       不是第一次坐飞机，却比初次还要多一些激动，要去梦里的大理。没有太多准备，来自心灵上的期待更多，背上行囊和这个说不上喜欢但也不讨厌的城市告别，……旅行的玄妙就在于，你来我往，去陌生的地方，换位感受，在打乱秩序的经纬里发现另一个自己。 <a href="http://go.taobao.com/note_view_18924.htm?type=2&fromId=1" target="_blank">[查看全文]</a></p>
				</div>
			</li>
			<li class="clearfix">
				<a class="pic" href="http://go.taobao.com/note_view_6173.htm" target="_blank"><img src="http://img03.taobaocdn.com/tps/i3/T131MEXlJXXXXEG.Zr-110-110.jpg" alt=""></a>
				<div class="extra">
					<h3><a href="http://go.taobao.com/note_view_6173.htm" target="_blank">厦门的夏，鼓浪屿的雨</a></h3>
					<p>【前言】：嗨喽大家好，我是喜欢旅行和摄影的(真)普通青年小蛮。ヾ(*>ω<)ノ゜ 大二的时候因为学校的项目去厦门大学交流了一年，虽然住在漳州校区可是在本部选了课所以每周都会去岛内两趟。作为一个在厦门居住了一年，之后又反复前往的人，经常被想去厦门旅游的朋友问到厦门游的问题，网上当然也有很多啦，可是小蛮是一个的文艺(伪)+2b(……待考)小青年，跟他们的玩法也有一定区别。 <a href="http://go.taobao.com/note_view_6173.htm" target="_blank">[查看全文]</a></p>
